import React from 'react';
import './DialogsPage.css';
import SidebarComponent from "../Sidebar/Sidebar";
import HeaderComponent from "../Header/Header";
import DialogsComponent from "../Dialogs/Dialogs";
import DialogsMessageComponent from "../Dialogs/DialogsMessage";
import {Route} from "react-router";

const DialogsPage = (props) => {

    return (
        <div className={'page-box'}>
            <div className={'header'}>
                <HeaderComponent/>
            </div>
            <div className="content-wrapper">
                <div className={'sidebar-block'}>
                    <SidebarComponent/>
                </div>
                <div className={'content'}>
                    <Route path='/dialogs/message' render={() => <DialogsMessageComponent />}/>
                    <DialogsComponent showDialogsCorrespondents={props.showDialogsCorrespondents}
                                      messages={props.messages}
                                      showDialog={props.showDialog}
                                      currentCorrespondentId={props.currentCorrespondentId}
                                      dialogsCorrespondents={props.dialogsCorrespondents} />

                </div>
            </div>
        </div>
    );
}

export default DialogsPage;
